import React from "react";

function Header({seeOrders}) {

    return (
        <header>
            <h3 onClick={() => seeOrders(false)}>Catalog</h3>
            <h1>Kyler's Online Store</h1>
            <h3 onClick={() => seeOrders(true)}>Order History</h3>
        </header>
    )
}

export default Header
